import axios from 'axios'

const API_URL = 'http://localhost:8080/clientes'

export default {
  getAllClientes() {
    return axios.get(API_URL)
  },

  createCliente(nome) {
    return axios.post(API_URL, { nome: nome }, { headers: { 'Content-Type': 'application/json' } })
  },

  deleteCliente(id) {
    return axios.delete(`${API_URL}/${id}`)
  }
}
